import React from "react";

function ColorItemInput(props) {
  return (
    <div>
      <input
        id={props.colorItemColor}
        type="radio"
        name="color"
        checked={props.color === props.colorItemColor}
        onChange={() => props.setAttribute("color", props.colorItemColor)}
      />
      <label
        htmlFor={props.colorItemColor}
        style={{
          backgroundColor: props.colorItemColor,
        }}
      ></label>
    </div>
  );
}
function ColorItemLabel(props) {
  return (
    <label
      htmlFor={props.colorItemColor}
      style={{
        backgroundColor: props.colorItemColor,
      }}
    ></label>
  );
}

function CreateAreaColor(props) {
  return (
    <div className="create-color">
      {/* Yellow */}
      <ColorItemInput
        colorItemColor="#f8c51b"
        color={props.color}
        setAttribute={props.setAttribute}
      />

      {/* Red */}
      <ColorItemInput
        colorItemColor="#f96262"
        color={props.color}
        setAttribute={props.setAttribute}
      />
      <ColorItemLabel colorItemColor="#f96262" />

      {/* LightBlue */}
      <ColorItemInput
        colorItemColor="#23d5e7"
        color={props.color}
        setAttribute={props.setAttribute}
      />
      <ColorItemLabel colorItemColor="#23d5e7" />
      {/* Purple */}
      <ColorItemInput
        colorItemColor="#dda6F7"
        color={props.color}
        setAttribute={props.setAttribute}
      />
      <ColorItemLabel colorItemColor="#dda6F7" />
      {/* DarkBlue */}
      <ColorItemInput
        colorItemColor="#2198d3"
        color={props.color}
        setAttribute={props.setAttribute}
      />
      <ColorItemLabel colorItemColor="#2198d3" />
      {/* Aqua */}
      <ColorItemInput
        colorItemColor="#6ecfbb"
        color={props.color}
        setAttribute={props.setAttribute}
      />
      <ColorItemLabel colorItemColor="#6ecfbb" />
      {/* LightGreen */}
      <ColorItemInput
        colorItemColor="#bee14f"
        color={props.color}
        setAttribute={props.setAttribute}
      />
      <ColorItemLabel colorItemColor="#bee14f" />
      {/* DarkGreen */}
      <ColorItemInput
        colorItemColor="#26ad60"
        color={props.color}
        setAttribute={props.setAttribute}
      />
      <ColorItemLabel colorItemColor="#26ad60" />
    </div>
  );
}

export default CreateAreaColor;
